class Data {
  Data({
    List<Video>? video,
  }) {
    _video = video;
  }

  Data.fromJson(dynamic json) {
    if (json['video'] != null) {
      _video = [];
      json['video'].forEach((v) {
        _video?.add(Video.fromJson(v));
      });
    }
  }
  List<Video>? _video;
  Data copyWith({
    List<Video>? video,
  }) =>
      Data(
        video: video ?? _video,
      );
  List<Video>? get video => _video;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_video != null) {
      map['video'] = _video?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

